        [HttpGet("testeupload")]
        public ActionResult<string> TesteUpload()
        {
            var fileName = Guid.NewGuid().ToString() + ".jpg";
            string base64Image = "";
            var container = "dev";

            // Limpa o hash enviado
            //Sempre que uma imagem no formato Base64 é enviada, 
            //ela contém primeiramente o formato da imagem, seguido pelo formato do Hash, 
            //neste caso, Base64.Porém, para persistir estas informações isto não é necessário, e gera um erro. 
            //Temos então que remover esta parte.
            //Para isto, utilizei um Regex que faz a limpeza destas informações e 
            //já deixa tudo pronto para ser enviado.
            var data = new Regex(@"^data:image\/[a-z]+;base64,").Replace(base64Image, "");

            // Gera um array de Bytes
            byte[] imageBytes = Convert.FromBase64String(data);

            // Define o BLOB no qual a imagem será armazenada
            var blobClient = new BlobClient("DefaultEndpointsProtocol=https;AccountName=petwisestorage;AccountKey=b3NUxlWBInexI+R+RoY5r+EIpZKKX7+LR2sVINNXjNyI2D4SSv4o/3IAnqTizCsPA5LOZUnyJN5ORekAKD65VA==;EndpointSuffix=core.windows.net", container, fileName);

            // Envia a imagem
            using (var stream = new MemoryStream(imageBytes))
            {
                blobClient.Upload(stream);
            }

            return blobClient.Uri.AbsoluteUri;
        }
    }
